import numpy as np
def sortString(w):
    w.sort()
    newStr=""
    for i in w:
        newStr +=i

    return newStr

def biggerIsGreater(w):
    # Write your code here
    strNew=""
    if w[-1] > w[-2]:
        strNew += w[0:len(w)-2]+w[-1]+w[-2]
        return strNew

    arr = list(w)
    for i in range(len(arr)-1,0,-1):
        j=i-1
        while(j>=0):
            if(arr[i]>arr[j]):
                x=arr.pop(i)

                arr.insert(j,x)
                if j==0:

                    return arr[0]+sortString(arr[1:])
                for i in arr:
                    strNew += i
                return strNew
            j-=1
    return "12"
